_body: !!python/object:github.GithubObject._ValuedAttribute
  value: "<!--\r\nThank you for your interest in and contributing to Elasticsearch!\
    \ There\r\nare a few simple things to check before submitting your pull request\r\
    \nthat can help with the review process. You should delete these items\r\nfrom\
    \ your submission, but they are here to help bring them to your\r\nattention.\r\
    \n-->\r\nA bug was fixed in the google cloud java API that caused IOExceptions\
    \ when uploading snapshots to GCS. Namely, this issue https://github.com/googleapis/google-cloud-java/issues/3410\
    \ and this PR fixing it \r\nhttps://github.com/googleapis/google-cloud-java/pull/3433.\
    \ There have been reports of this bug appearing in Elasticsearch https://github.com/elastic/elasticsearch/issues/35229.\
    \ Let's bump to the latest release of those google cloud java APIs. \r\n\r\nCloses\
    \ https://github.com/elastic/elasticsearch/issues/35229 \r\n\r\n\r\ncc @ywelsch "
